// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

contract TomatoChain is ERC20, AccessControl {
    bytes32 private constant COMPANY_ROLE = keccak256("COMPANY_ROLE");

    struct Product {
        uint productID;
        string productName;
        uint productPrice;
        string productDescription;
        string Provider;
        string Retailer;
        bool isConfirmByRetailer;
        uint dateOfManufacture;
        uint expirationDate;
        uint quantity;
    }

    mapping(uint => Product) private productByProductId;
    mapping(string => uint) public totalRetailer;
    mapping(string => uint) public totalProvider;
    mapping(string => mapping(uint => Product)) public totalProductRetailer;
    mapping(string => mapping(uint => Product)) public totalProductProvider;

    constructor() ERC20("TomatoChain", "TOMATO") {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(COMPANY_ROLE, msg.sender);
    }


    // Modifiers zone
    modifier checkConfirmByRetailer (uint productID){
        require(productByProductId[productID].isConfirmByRetailer == false, "This product already confirmed!");
        _;
    }


    // Events zone
    event productEvent(Product product);

    // event AcceptByRetailerEvent(Product product);


    // Function zone
    // function getProductOfRetailer (string memory retailer, uint index) external view returns (Product memory) {
    //     return totalProductRetailer[retailer][index];
    // }

    // function getProductOfProvider (string memory provider, uint index) external view returns (
    //     uint productID,
    //     string memory productName,
    //     uint productPrice,
    //     string memory productDescription,
    //     string memory Provider,
    //     string memory Retailer,
    //     bool isConfirmByRetailer,
    //     uint dateOfManufacture,
    //     uint expirationDate,
    //     uint quantity
    // ) {
    //     Product memory product = totalProductProvider[provider][index];
    //     return (
    //         product.productID,
    //         product.productName,
    //         product.productPrice,
    //         product.productDescription,
    //         product.Provider,
    //         product.Retailer,
    //         product.isConfirmByRetailer,
    //         product.dateOfManufacture,
    //         product.expirationDate,
    //         product.quantity
    //     );
    // }

    function acceptByRetailer (uint productID, string memory retailer, string memory provider, uint index) external onlyRole(COMPANY_ROLE) checkConfirmByRetailer(productID) {
        productByProductId[productID].isConfirmByRetailer = true;
        totalProductRetailer[retailer][index].isConfirmByRetailer = true;
        totalProductProvider[provider][index].isConfirmByRetailer = true;
        updateStatusOnProvider(productID, provider);
        emit productEvent(productByProductId[productID]);
    }
    function updateStatusOnProvider (uint productID, string memory provider) private {
        uint _totalProvider = totalProvider[provider];
        for (uint i = 0; i <= _totalProvider; i++) {
            if (totalProductProvider[provider][i].productID == productID) {
                totalProductProvider[provider][i].isConfirmByRetailer = true;
            }
        }
    }

    function createProduct(
        uint productID,
        string memory productName,
        uint productPrice,
        string memory productDescription,
        string memory Provider,
        bool isConfirmByRetailer,
        string memory Retailer,
        uint dateOfManufacture,
        uint expirationDate,
        uint quantity
    ) external onlyRole(COMPANY_ROLE) {
        Product memory product = Product(
            productID,
            productName,
            productPrice,
            productDescription,
            Provider,
            Retailer,
            isConfirmByRetailer,
            dateOfManufacture,
            expirationDate,
            quantity
        );
        productByProductId[productID] = product;
        totalRetailer[Retailer] += 1;
        totalProvider[Provider] += 1;
        totalProductRetailer[Retailer][totalRetailer[Retailer]] = product;
        totalProductProvider[Provider][totalProvider[Provider]] = product;
        emit productEvent(product);
    }

    function mint(address to, uint256 amount) external onlyRole(DEFAULT_ADMIN_ROLE) {
        _mint(to, amount);
    }

    function setCompany(address company) external onlyRole(DEFAULT_ADMIN_ROLE) {
        _grantRole(COMPANY_ROLE, company);
    }
}
